          <p className="cnnContents">
            <span className="marqueeStyle">
              <img src={leaf} alt="" /> Mugs
            </span>

            <span className="marqueeStyle2">
              &nbsp;continuous infinite text loop 3 continuous infinite text
              loop 4&nbsp;
            </span>
          </p>
        </div>
      </div>
    </section>
  );
};
export default Animation;
